import React, { Fragment } from 'react';

const ListInput = ({submit, input}) => {
    return (
        <Fragment>
            <div className='list-input'>
                <input onChange={input} type='text' placeholder='add item' />
                <button onClick={submit}>Submit</button>
            </div>
        </Fragment>
    )
}

export default ListInput;
